import React, { useState, useEffect } from "react";
import { Form, Button } from "react-bootstrap";
import axios from "axios";
import { useNavigate } from "react-router-dom";

function Signup() {
  let navigate = useNavigate();
  let [firstname, setFirstName] = useState("");
  let [lastname, setLastName] = useState("");
  let [mobile, setMobile] = useState("");
  let [email, setEmail] = useState("");
  let [password, setPassword] = useState("");
  let [confirmPassword, setConfirmPassword] = useState("");
  let role = 2;

  let [passwordMatch, setMatch] = useState("");

  useEffect(() => {
    if (password === confirmPassword) {
      setMatch(false);
    } else {
      setMatch(true);
    }
  });

  let handleSubmit = async () => {
    let res = await axios.post("http://localhost:4000/signup", {
      firstname,
      lastname,
      mobile,
      email,
      password,
      role,
    });
    console.log(res)
    if (res.data.statusCode === 200) {
      navigate("/login");
    }
  };

  return (
    <div>
      <h1 className="text-center mt-4">SignUp Here</h1>
      <Form style={{ width: "30%" }} className="m-auto mt-3">
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>First Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter First Name"
            required
            onChange={(e) => {
              setFirstName(e.target.value);
            }}
          />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>Last Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter Last Name"
            required
            onChange={(e) => {
              setLastName(e.target.value);
            }}
          />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label>Mobile</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter Mobile"
            required
            onChange={(e) => {
              setMobile(e.target.value);
            }}
          />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>Email address</Form.Label>
          <Form.Control
            type="email"
            placeholder="Enter Email"
            required
            onChange={(e) => {
              setEmail(e.target.value);
            }}
          />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control
            type="password"
            placeholder="Enter Password"
            required
            onChange={(e) => {
              setPassword(e.target.value);
            }}
          />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label>Confrim Password</Form.Label>
          <Form.Control
            type="password"
            placeholder="Enter Confirm Password"
            required
            onChange={(e) => {
              setConfirmPassword(e.target.value);
            }}
          />
        </Form.Group>
        <Button
          variant="primary"
          type="submit"
          className="d-flex m-auto"
          onClick={() => {
            handleSubmit();
          }}
        >
          Submit
        </Button>
        {passwordMatch? (
          <div className="text-center mt-4" style={{ color: "red" }}>
            Password Must Be Match!
          </div>
        ) : (
          <></>
        )}
      </Form>
      <div className="d-flex justify-content-center mt-4">
        <span className="text-center">Already have an account &nbsp;?</span>
        &nbsp;
        <a href="/login">Login</a>
      </div>
    </div>
  );
}

export default Signup;
